                        "Name": "하늘에서 무가 내려와",
                        "Desc": "어떤 선인이 만든 「월계 · 투척형」 기관을 출전시켜 요요를 돕는다.<br>홀드 시 다른 방식으로 발동한다.<br><br><color style='color:#FFD780;'>홀드</color><br>조준 상태로 진입해 투척할 방향을 결정한다.<br><br><color style='color:#FFD780;'>월계 · 투척형</color><br>하얀 무를 투척한다. 하얀 무는 캐릭터나 적에게 명중 시, 폭발하여 일정 범위 내의 적에게 <color style='color:#99FF88;'>풀 원소 피해</color>를 주고, 범위 내 캐릭터의 HP를 회복한다. HP 회복량은 요요의 HP 최대치에 따라 결정된다. 적이나 캐릭터에게 명중하지 못할 경우, 하얀 무는 낙하한 곳에 남아서 적이나 캐릭터와 접촉하거나 지속 시간이 끝나면 폭발한다.<br>월계 · 투척형은 주변 상황에 따라 하얀 무를 투척할 목표를 선택한다:<br> · 모든 주변 캐릭터의 HP가 70%를 초과하면 주변의 적 1명에게 하얀 무를 투척한다.<br> · 주변에 HP가 70% 이하인 캐릭터가 존재하면, 주변 필드 위 캐릭터 중 HP 비율이 가장 낮은 캐릭터에게 하얀 무를 투척한다. 주변에 적이 존재하지 않으며, 모든 캐릭터의 HP가 70%를 초과하고 100% 미만인 경우, 캐릭터를 향해 하얀 무를 투척한다. 그렇지 않은 경우, 주위를 향해 랜덤으로 투척한다.<br><br>월계 · 투척형은 동시에 최대 2개까지 존재할 수 있다.<br><br><i>「몸에 좋고 맛도 좋은 무가 왔어! 아, 무가 만병통치약이라는 뜻은 아니야. 그래도 먹으면 몸에 좋을 거라구!」</i>",
